  false,\n\t\"url\": null,\n\t\"notes\": \"BPI Zones are derived from a focal mean
  analysis on bathymetry and slope. The grid is based on gridded (5 m cell size) multibeam
  bathymetry, collected aboard R/V AHI, merged with seafloor depths derived from IKONOS
  satellite imagery. BPI Zones was was created using the Benthic Terrain Modeler (http://www.csc.noaa.gov/products/btm/).
  Cell values represent one of 4 classes (crest, depression, flat, slope) in an index
  of seafloor terrains. This data set is for the bank top and lagoon environments
  of Pearl and Hermes Atoll, Hawaii, USA.\",\n\t\"license_title\": null,\n\t\"extras\":
